import './App.css';
import CalendarHeatmap  from "reactjs-calendar-heatmap";
import React, { useEffect, useRef } from "react";

function groupBy(rawData, key) {
    return rawData.reduce(function(previousVal, currentVal) {
        (previousVal[currentVal[key]] = previousVal[currentVal[key]] || []).push(currentVal);
        return previousVal;
    }, {});
};

let streamingData = null;

fetch("StreamingHistoryDesi.json")
    .then(response => response.json())
    .then(data => {
        data.forEach(function (entry, idx, data) {
            data[idx]["date"] = data[idx].endTime.split(" ")[0];
            delete data[idx].artistName;
            delete data[idx].trackName;
            delete data[idx].endTime;
        });

        let filteredData = Object.values(groupBy(data, "date"));

        streamingData.current = filteredData.map(function (day) {
            day = day.reduce(function (prev, cur) {
                prev["totalTracks"] = prev["totalTracks"] + 1;
                prev["total"] = prev["total"] + cur["msPlayed"];
                return prev;
            }, {"totalTracks": 0, "total": 0, "details": [], "summary": [{"name": "test"}]});
            return day;
        });

        console.log(streamingData);
    })


function App() {

    const red = "#8a0d0d";
    const overview = "year";
    const printFn = function (val) {
        console.log(val);
    };
    const streamingData = useRef();

    useEffect(()=> {
        fetch("StreamingHistoryDesi.json")
            .then(response => response.json())
            .then(data => {
                data.forEach(function (entry, idx, data) {
                    data[idx]["date"] = data[idx].endTime.split(" ")[0];
                    delete data[idx].artistName;
                    delete data[idx].trackName;
                    delete data[idx].endTime;
                });

                let filteredData = Object.values(groupBy(data, "date"));

                streamingData.current = filteredData.map(function (day) {
                    day = day.reduce(function (prev, cur) {
                        prev["totalTracks"] = prev["totalTracks"] + 1;
                        prev["total"] = prev["total"] + cur["msPlayed"];
                        return prev;
                    }, {"totalTracks": 0, "total": 0, "details": [], "summary": [{"name": "test"}]});
                    return day;
                });

                console.log(streamingData);
            })
    })

    return (
    <div className="App">
      <header className="App-header">
          <CalendarHeatmap
              data={streamingData.current}
              color={red}
              overview={overview}
              handler={printFn}>
          </CalendarHeatmap>
      </header>
    </div>
  );
}

export default App;
